import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage/HomePage";
import ReportPage from "./pages/ReportPage/ReportPage";
import { UseProvider } from "./pages/HomePage/useContext";

function App() {
  return (
    <Router>
      <UseProvider>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/report-page/:menuItem" element={<ReportPage />} />
        </Routes>
      </UseProvider>
    </Router>
  );
}

export default App;
